import React, {Component} from 'react'
import './App.css'
import Header from "./components/Header";

class App extends Component {

    state = {
        buttons: [
            {name: 'Hello'},
            {name: 'World'},
            {name: 'Valera'},
            {name: 'Andrey'},
        ]
    };

    render() {
        return (
            <div className={'app'}>
                <Header buttons={this.state.buttons}/>
            </div>
        );
    }
}


export default App
